css:
@-moz-document domain("www.nitrotype.com")
{
  .btn--a
  {
    background: linear-gradient(to right, #D4AF37, #D4AF37);
    border: 1px solid #D4AF37;
  }

  .btn--a:hover
  {
    background: linear-gradient(to right, #D4AF37, #D4AF37);
  }

  .btn--a:focus
  {
    background: linear-gradient(to right, #D4AF37, #D4AF37);
  }

  .theme--pDefault .profile-body
  {
    color: #D4AF37;
  }

  .card--a
  {
    color: #D4AF37;
  }

  .btn--ghost
  {
    background: linear-gradient(90deg, #D4AF37 0%, #D4AF37 25%, #D4AF37 50%, #D4AF37 75%, #D4AF37 100%);
    color: #000;
  }

  .btn--ghost:hover
  {
    background: linear-gradient(90deg, #D4AF37 0%, #D4AF37 25%, #D4AF37 50%, #D4AF37 75%, #D4AF37 100%);
    color: #000;
  }

  .btn--ghost:focus
  {
    background: linear-gradient(90deg, #D4AF37 0%, #D4AF37 25%, #D4AF37 50%, #D4AF37 75%, #D4AF37 100%);
    color: #000;
  }

  .btn--c
  {
    background-color: #D4AF37;
    border: 1px solid #D4AF37;
  }

  .btn--c:hover
  {
    background-color: #D4AF37;
  }

  .btn--c:focus
  {
    background-color: #D4AF37;
  }

  .btn--d
  {
    background-color: #D4AF37;
  }

  .btn--d
  {
    border: 1px solid #D4AF37;
  }

  .btn--d:hover
  {
    background-color: #D4AF37;
  }

  .btn--d:focus
  {
    background-color: #D4AF37;
  }

  .btn--b
  {
    background: linear-gradient(to right, #D4AF37, #D4AF37);
  }

  .btn--b:hover
  {
    background: linear-gradient(to right, #D4AF37, #D4AF37);
  }

  .btn--b:focus
  {
    background: linear-gradient(to right, #D4AF37, #D4AF37);
  }

  .card--b
  {
    color: #D4AF37;
  }

  .tabs--a .tab.is-active
  {
    color: #D4AF37;
  }

  .tabs--a .tab:hover
  {
    color: #D4AF37;
  }

  .tabs--a .tab
  {
    color: #D4AF37;
  }

  .btn.is-active.btn--stroke-i
  {
    background-color: #D4AF37;
  }

  .news-header
  {
    color: #D4AF37;
  }

  .btn--stroke-i
  {
    background-color: #D4AF37;
  }

  .btn--stroke-i:hover
  {
    background-color: #D4AF37;
  }

  .card--e
  {
    color: #D4AF37;
  }

  .card--d
  {
    color: #D4AF37;
  }

  .dropdown--account.is--online .dropdown-trigger
  {
    color: #D4AF37;
  }

  .dropdown--account .dropdown-link:hover
  {
    background: #D4AF37;
  }

  .dropdown--account .dropdown-item:last-of-type .dropdown-link:hover
  {
    background: #D4AF37;
  }

  ::selection
  {
    background: #D4AF37;
    color: #000;
  }

  .notify
  {
    background: #D4AF37;
    color: #000;
  }

  .notify:before
  {
    background: #D4AF37;
    color: #000;
  }
}
